export const CardProducto = () => {
    return (
        <div>
            <h1 className="card-title">NOMBRE PRODUCTO</h1>
            <p>Precio: </p>
            <p>Detalles: </p>
            <a href="google.com" className="card-btn">GODEL</a>
        </div>
    );
};
